import { Component, OnInit } from '@angular/core';
import { MatDialogRef } from '@angular/material/dialog';

@Component({
  selector: 'app-validar',
  templateUrl: './validar.component.html',
  styleUrls: ['./validar.component.scss']
})
export class ValidarComponent implements OnInit {

  constructor(public dialogRef: MatDialogRef<ValidarComponent>) {  
  }

  ngOnInit(): void {
    throw new Error('Method not implemented.');
  }

  onNoClick(): void {
    this.dialogRef.close(false);
  } 

  confirmado(): void {
    this.dialogRef.close(true);
  }

}
<div>
  <h1 mat-dialog-title>Confirmación</h1>
  <div mat-dialog-content>
    ¿Esta seguro que desea grabar los cambios hechos?
  </div>
</div>

<div mat-dialog-actions style="justify-content: center !important;">
  <button mat-button mat-dialog-close class="example-label" (click)="onNoClick()"><i class="fa fa-close"></i>&nbsp;
    No
  </button>

  <button mat-button mat-dialog-close cdkFocusInitial color="primary" (click)="confirmado()"><i
      class="fa fa-check"></i>&nbsp; Si
  </button>
</div>
